import './App.css';
import 'gridstack/dist/gridstack.min.css';
import { GridStack } from 'gridstack';

function App() {
  var grid = GridStack.init();
  grid.addWidget({w: 2, content: 'item 1'});
  return (
    <div className="App">
      <div class="grid-stack"></div>
    </div>
  );
}

export default App;
